import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.header`
  background: #2c3e50;
  color: white;
  padding: 1rem 2rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;
const Header = () => {
  return (
    <HeaderContainer>
      <Nav>
         <Logo to="/">.</Logo> 
        <NavLinks>
          <NavLink to="/noticeboard">게시판</NavLink>
          <NavLink to="/about">BKO</NavLink>
          <NavLink to="/services">MLB</NavLink>
          <NavLink to="/contact">게임</NavLink>
        </NavLinks>
        <NavLink to="/contact">로그인</NavLink>
      </Nav>
    </HeaderContainer>
  );
};

export default Header;
